import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import AppBar from '@material-ui/core/AppBar';

class Navigation extends  Component{
    render() {
        return(
            <div>
                <AppBar color={blue}/>
            </div>
        )
    }
}


export default withRouter(Navigation);
